import {connect}        from 'react-redux';
import Organization        from '../../components/organization/Organization';
import {fetchOrgLocations, getOrgDetails} from "../../actions/profileApi";

const mapStateToProps = (state) => ({
    orgDetails: state.orgDetails,
    orgLocations: state.orgLocations
});

const mapDispatchToProps = (dispatch, ownProps) => ({
    fetchOrgDetails: () =>  dispatch(getOrgDetails(ownProps.match.params.id)),
    fetchOrgLocations: () => dispatch(fetchOrgLocations(ownProps.match.params.id))
});

export default connect(mapStateToProps, mapDispatchToProps)(Organization);
